function HamburgerMeny(){let nav_mobil=document.getElementById("nav_mobil"),top=document.getElementById("top"),top_2=document.getElementById("top_2");"block"===nav_mobil.style.display?(nav_mobil.style.display="none",top.style.marginTop="0vh",top_2.style.marginTop="0vh"):(nav_mobil.style.display="block",top.style.marginTop="6vh",top_2.style.marginTop="6vh")}